class Solution_es:
    def traverse(self, y, x, board, rows, cols, word, n, depth, visited):
        if (y, x) in visited:
            return False
        if depth == n:
            return True
        if word[depth] != board[y][x]:
            return False
        visited[(y, x)] = True
        res = []
        dirs = [[-1, 0], [1, 0], [0, -1], [0, 1]]
        for dir in dirs:
            ny = y + dir[0]
            nx = x + dir[1]
            if (0 <= ny < rows and 0 <= nx < cols):
                res.append(self.traverse(ny, nx, board, rows, cols, word, n, depth+1, visited))
        del visited[(y, x)]
        return True if True in res or depth+1 == n else False
        
    def findWords(self, board: 'List[List[str]]', words) -> bool:
        out = []
        rows = len(board)
        cols = len(board[0])
        for word in words:
            sx = -1
            is_found = False
            for y in range(len(board)):
                for x in range(len(board[0])):
                    if board[y][x] != word[0]:
                        continue
                    sx = x
                    if True == self.traverse(y, x, board, rows, cols, word, len(word), 0, {}):
                        is_found = True
                        break
                if True == is_found:
                    break
            if False == is_found:
                continue
            out.append(word[:])
        return out


class TrieNode:
    def __init__(self, letter):
        self.letter = letter
        self.eow = False
        self.children = {}

class Trie:
    def __init__(self):
        self.root = TrieNode(None)

    def insert(self, word):
        cur = self.root
        for letter in word:
            if letter not in cur.children:
                cur.children[letter] = TrieNode(letter)
            cur = cur.children[letter]
        cur.eow = True

class Solution(object):
    def search(self, y, x, cur, board, rows, cols, trace, res):
        letter = board[y][x]
        if None == letter:
            return
        if letter not in cur.children:
            return

        trace.append(board[y][x])
        if True == cur.children[letter].eow:
            if ''.join(trace) not in res:
                res.append(''.join(trace))

        board[y][x] = None
        for oy, ox in [(-1, 0), (1, 0), (0, -1), (0, 1)]:
            ny = y+oy
            nx = x+ox
            if 0 <= ny < rows and 0 <= nx < cols:
                self.search(ny, nx, cur.children[letter], board, rows, cols, trace, res)
        trace.pop()
        board[y][x] = letter

    def findWords(self, board, words):
        if not board:
            return []
        trie = Trie()
        for word in words:
            trie.insert(word)
        res, rows, cols = [], len(board), len(board[0])

        for y, row in enumerate(board):
            for x, ch in enumerate(board[0]):
                self.search(y, x, trie.root, board, rows, cols, [], res)
        return res






